import React from "react";
import Main from "./Main/Main";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import "../css/core.css";
import About from "./About/About";
import Service from "./Service/Service";
import Support from "./Support/Support";
import styled from "styled-components";
function App() {
  return (
    <Test>
      <div className="wrapper">
        <div className="top">
          <img
            src="/assets/header/logo.png"
            srcSet="/assets/header/logo@2x.png 2x, /assets/header/logo@3x.png 3x"
            alt=""
          />
        </div>
        <div className="content">
          <div className="logo">
            <img
              src="/assets/test/test.png"
              srcSet="/assets/test/test@2x.png 2x, /assets/test/test@3x.png 3x"
              alt=""
            />
          </div>
          <div>홈페이지 리뉴얼 중입니다</div>
          <div className="green">블로그에서 무료상담 신청해보세요</div>
        </div>
      </div>
    </Test>
    // <Router>
    //   <Routes>
    //     <Route path="/" exact element={<Main />} />
    //     <Route path="/about" exact element={<About />} />
    //     <Route path="/service" exact element={<Service />} />
    //     <Route path="/support" exact element={<Support />} />
    //   </Routes>
    // </Router>
  );
}

export default App;

const Test = styled.main`
  width: 100%;
  height: 100%;
  & > .wrapper {
    width: 1366px;
    margin: 0 auto;
    padding-left: 75px;
    & > .top {
      width: 180px;
      height: 64px;
      display: flex;
      align-items: center;
    }
    & > .logo {
      width: 152.4px;
      height: 166px;
    }
    & > .content {
      width: 100%;
      height: 100%;
      display: flex;
      flex-direction: column;
      align-items: center;
    }
  }
`;
